  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Great
  Swamp National Wildlife Refuge outlines Refuge accomplishments during the 1988 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  management planning, compliance with environmental and cultural resource mandates,
  and research and investigations. Refuge administration is outlined; information
  about personnel, youth programs, volunteer programs, funding, safety, and technical
  assistance is given. Habitat management is also covered; subjects include wetlands,
  forests, grasslands, fire management, pest control, wilderness and special areas,
  WPA easement monitoring. The wildlife section of the report discusses endangered
  and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  other migratory birds, game mammals, other resident wildlife, wildlife propagation
  and stocking, scientific collections, animal control, marking and bird banding,
  and disease prevention and control. The public uses of the Refuge described in this
  report include outdoor classrooms, interpretive programs, hunting, wildlife observation,
  other wildlife oriented recreation, other non-wildlife oriented recreation, and
  law enforcement. The equipment and facilities section of the report provides information
  about new construction, rehabilitation, major maintenance, equipment utilization
  and replacement, communications systems, computer systems, and energy conservation.
  Cooperative programs and items of interest are provided at the end. Photographs
  and Refuge brochures are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
